  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0100077 includes chemical,
  physical and time series data collected from MOORINGS in the North Pacific Ocean
  and South Pacific Ocean from 2004-05-23 to 2011-09-01. These data include AIR-SEA
  DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT
  SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
  pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE.
  The instruments used to collect these data include Bubble type equilibrator for
  autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
  data were collected by Adrienne Sutton, Christopher Sabine, Stacy Maenner and Sylvia
  Musielewicz of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part
  of the Mooring_TAO140W data set. CDIAC associated the following cruise ID(s) with
  this data set: T14020040523nnThe Global CO2 Time-series and Moorings Project involves
  international groups from 18 countries who have mounted sensors on moored buoys
  to provide high resolution time-series measurements of atmospheric boundary layer
  and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series and Moorings
  Project is coordinated by UNESCO International Ocean Carbon Coordination Project
  (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
